import React from 'react'
import { Text, View, StyleSheet,Image,TouchableOpacity } from 'react-native'
import { Ionicons,MaterialIcons} from '@expo/vector-icons';
import ChatScreen from '../ChatScreen';
const ChatComponent = (props) => {
    console.log(props); 
  return (
    <TouchableOpacity onPress={()=>{
        props.navigation.navigate("chat-screen", {name: props.name, _id: props._id})
    }} style={styles.container}>
        <View style={styles.imageContainer} >
            <Image source={{
                uri: "data:image/png;base64,",
            }}  style={styles.image}/>
        </View>
        <View style={styles.textContainer}>
            <View style={styles.tcTop}>
                <Text style={{fontWeight:700, fontSize:18}}> {props.name} </Text>
                <Text>{props.time}</Text>
            </View>
            <View style={styles.tcBottom}>
                <Text>{props.name}:{props.message}</Text>
                { props.notification && <View style={{backgroundColor:"#0096FF", borderRadius:50, width:20, height:20, alignItems:"center", justifyContent:"center"}}></View>}
            </View>
        </View>
    </TouchableOpacity>
    )
}

const styles = StyleSheet.create({
    container:{ 
        height:70,
        borderBottomWidth: .5,
        borderBlockColor: "#e3e3e3",
        marginTop: 10,
        flexDirection: "row",
        marginRight: 15,
    },
    imageContainer:{ 
        alignItems: "center",
        justifyContent: "center",
        flex:.25,
    },
    image:{ 
        width: 60,
        height: 60,
        borderRadius: 50,
        marginRight: 10,
    }, 
    textContainer:{ 
        flex:.75, 
    },
    tcTop:{ 
        flex:1 , 
        alignItems: "center",
        flexDirection: "row",
        justifyContent: "space-between",
    },
    tcBottom:{ 
        flex:1 , 
        alignItems: "center",
        flexDirection: "row",
        justifyContent: "space-between",
    }
});

export default ChatComponent